name: dashdot_dash_1
services:
  dashdot_dash_1:
    cpu_shares: 90
    command:
      - yarn
      - start
    deploy:
      resources:
        limits:
          memory: 15891M
    environment:
      - DASHDOT_RUNNING_IN_DOCKER=true
      - NODE_VERSION=18.17.1
      - PATH=/usr/local/sbin:/usr/local/bin:/usr/sbin:/usr/bin:/sbin:/bin
      - YARN_VERSION=1.22.19
    image: mauricenino/dashdot:latest
    labels:
      icon: data:image/jpeg;base64,
    ports:
      - target: 3001
        published: "86"
        protocol: tcp
    privileged: true
    restart: unless-stopped
    volumes:
      - type: bind
        source: /
        target: /mnt/host
    x-casaos:
      envs:
        - container: PATH
          description:
            en_us: ""
        - container: NODE_VERSION
          description:
            en_us: ""
        - container: YARN_VERSION
          description:
            en_us: ""
        - container: DASHDOT_RUNNING_IN_DOCKER
          description:
            en_us: ""
      ports:
        - container: "3001"
          description:
            en_us: ""
      volumes:
        - container: /mnt/host
          description:
            en_us: ""
    devices: []
    cap_add: []
    network_mode: dashdot_default
    container_name: ""
x-casaos:
  architectures:
    - amd64
  author: CasaOS User
  category: unknown
  description:
    en_us: ""
  developer: unknown
  hostname: 192.168.1.108
  icon: data:image/jpeg;base64,
  index: /
  main: dashdot_dash_1
  port_map: "86"
  scheme: http
  store_app_id: dashdot_dash_1
  tagline:
    en_us: This is a compose app converted from a legacy app (CasaOS v0.4.3 or
      earlier)
  thumbnail: ""
  tips:
    custom: This is a compose app converted from a legacy app (CasaOS v0.4.3 or
      earlier)
  title:
    custom: dashdot_dash
    en_us: dashdot_dash_1
